import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Locate and select the price sort option
    const sortSelector = '#sortSelect';
    await page.waitForSelector(sortSelector, { timeout: 5000 });

    // Select 'Price: Low to High' from the dropdown
    await page.selectOption(sortSelector, 'price-low');

    // Take a screenshot after applying the sort
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_price_sorted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_price_sorted.png'));

    // Extract the selected value to confirm the action
    const selectedSortValue = await page.$eval(sortSelector, el => el.value);

    return {
      success: true,
      action: "Applied 'Price: Low to High' sort filter.",
      extractedData: {
        selectedSortOption: selectedSortValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price sort filter.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
